import React, {useState} from "react";
import ButtonGroup from '@mui/material/ButtonGroup';
import Tab from "./IDE/Tab";

import TextPopup from "./IDE/TextPopup";


function Tabs(props) {

    return (
        <div>
            <div className="flex mb-2">
                <ButtonGroup variant="contained" aria-label="outlined primary button group">
                    <Tab color="primary" name="File 1" />
                    {/*<Tab color="inherit" name="File 2" />*/}
                    
                    
                </ButtonGroup>
                <div className="mx-4">
                    <TextPopup formTitle="Create a new REPL" formBody="Enter a name for your new REPL environment: " addREPL={props.addREPL} />
                </div>
                
            </div>
            
        </div>
    )

}


export default Tabs;
